import React, { useEffect, useState } from 'react';
import axios from "axios";
import { useNavigate } from 'react-router-dom';
function Bsolo1r() {
    const navigate=useNavigate();
    const [pd,spd] = useState([1,1,1,1,1,1])
    let rendr = []
    useEffect(()=>{
        const sr=async()=>{
            await axios.get("http://localhost:4000/bs1r").then(d=>spd((d.data.bsolo1)))
            pd.map((i,d)=>{
                rendr.push(
                    <tr key={d.id}>
                        <td>{i.username}</td>
                        <td>tjt</td>
                        <td>gfhj</td>
                        <td>fgj</td>
                    </tr>
                )
            })
            console.log(rendr)
        }
        sr();
    },[]);
    const cr = () => {
        navigate("/result");
      };
  return (
    <div className="sr">
      <div className="rc">
        <button id="rc" onClick={cr}>
          X
        </button>
      </div>
      <div className="pd">
        <div className="w">WINNER : 100</div>
        <div className="r">RUNNER : 50</div>
        <div className="k">KILL : 10</div>
      </div>
      <table>
        <tr>
            
          <th>POSITION</th>
          <th>PLAYER NAME</th>
          <th>KILLS</th>
          <th>CASH</th>
        </tr>
            
            { 
                rendr
                
            }
                    
                
                
                
            
      </table>
    </div>
  )
}
export default Bsolo1r
